import React from "react";
import "./content.css"
const Content = () => {
  return (
    <>
      <div>
        <p id="content">
          We offer you high level of security to store your
          confidential passwords without worrying of them getting stolen.
        </p>
      </div>
    </>
  );
  };

  export default Content;
